    salinity and other variables collected from Surface underway observations using
    Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous
    carbon dioxide (CO2) measurement and other instruments from HEALY in the Arctic
    Ocean, Beaufort Sea and others from 2011-05-27 to 2011-12-16 (NCEI Accession 0144345)",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-03-07T18:33:28.339484",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf001d0",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144345 includes Surface
    underway data collected from HEALY in the Arctic Ocean, Beaufort Sea, Bering Sea,
    Coastal Waters of SE Alaska, Gulf of Alaska, Hawaiian Islands Humpback Whale National
    Marine Sanctuary, North Pacific Ocean and Northwest Passage from 2011-05-27 to 2011-12-16.
    These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon
    dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
    these data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
    for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Taro
    Takahashi and Stew Sutherland of Columbia University; Lamont-Doherty Earth Observatory
    and Colm Sweeney of University of Colorado at Boulder; Cooperative Institute for
    Research In Environmental Sciences as part of the VOS_Healy_Lines_2011 data set.
    CDIAC associated the following cruise ID(s) with this data set: 32HQ20110527nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
    equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"license_title":
